import React from "react";

function Signin() {
  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        <div>
          <div>
            <p>LOGIN</p>
          </div>
          <div>
            <p>Email</p>
            <input type="text" placeholder="Email " required />
          </div>
          <form action=""></form>
        </div>
      </div>
    </div>
  );
}

export default Signin;
